import React from 'react';
const Litters = () =>{
        const AllLitters =[
            {_id: 1, name: "Origin", puppyCount: 3, season: 'Spring', year: 2020, Image: ''},
            {_id: 2, name: "Everest", puppyCount: '', season: '', year: 2020, Image: '' },
        ]
    return (
    <div>
        {AllLitters.map(litters =>
        <div>
            {litters.id}

            {litters.name}
            <br />
            {litters.year}
            </div>
            )}


    </div>
    )
    }
    export default Litters;
